from typing import List
class Solution:
    def minAbsoluteSumDiff(self, nums1: List[int], nums2: List[int]) -> int:
        res = 0
        tmp, mytuple = -float("inf"), ()
        for n1, n2 in zip(nums1, nums2):
            if abs(n1-n2) > tmp:
                tmp = abs(n1-n2)
                mytuple = (n1, n2)
            res = (res + abs(n1-n2))%(10**9 + 7)
        res = (res - abs(mytuple[0]-mytuple[1]))%(10**9 + 7)
        tmp = -float("inf")
        target = abs(mytuple[0]-mytuple[1])
        for n1 in nums1:
            if abs(n1-mytuple[1]) < target:
                tmp = n1
                target = abs(n1-mytuple[1])

        if tmp != -float("inf"):
            candidate = res + abs(tmp-mytuple[1])
        else:
            candidate = (res + abs(mytuple[0]-mytuple[1]))%(10**9 + 7)
        return 0 if res == 0 else (candidate)%(10**9 + 6)


solution = Solution()
print(solution.minAbsoluteSumDiff(nums1, nums2))

